package main

import (
	"fmt"
)

//general parser solution

func main() {
	input := ""

	for i := 0; i < len(input)-4; i++ {
		s := input[i : i+14]

		if match(s) {
			fmt.Println(i + 14)
			return
		}
	}
}

func match(s string) bool {

	freq := make(map[byte]int)

	for i := 0; i < len(s); i++ {
		freq[s[i]]++
		if freq[s[i]] > 1 {
			return false
		}
	}
	return true
}
